import React from 'react';


import logo from '../assets/logo.svg'

export default function Main({ match }) {
    return (
        <div className="main-container">
            <img src={logo} alt="DevCom" />
            <ul>
                <li>
                    <img src="https://avatars0.githubusercontent.com/u/23192463?v=4" alt=""/>
                    <footer>
                        <strong>Eliabe Leal</strong>
                        <p>Software Engineer at @sesdsgovpb, programming lover and musician in his spare time.</p>
                    </footer>
                </li>
            </ul>
        </div>
    );
}
